import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHtml5, faCss3, faJs, faReact, faNodeJs } from '@fortawesome/free-brands-svg-icons';

export default function Technology() {

  const technologies = [
    { name: "JavaScript", icon: faJs },
    { name: "HTML", icon: faHtml5 },
    { name: "CSS", icon: faCss3 },
    { name: "React", icon: faReact },
    { name: "Node.js", icon: faNodeJs }
  ];

  return (
    <div className="bg-base-100 about py-20 px-36 flex flex-col justify-center items-center">
      {/* Title */}
      <h1 className="text-5xl font-bold p-2 mb-10 bg-primary rounded-lg inline-block">Technologies</h1>

      {/* Two columns layout */}
      <div className="grid grid-cols-2 gap-4">
        {technologies.map((tech, index) => (
          <div key={index} className="flex items-center justify-center p-4 bg-primary rounded-lg">
            <FontAwesomeIcon icon={tech.icon} size="3x" className="text-white" />
            <p className="ml-2 text-white">{tech.name}</p>
          </div>
        ))}
      </div>

      {/* Additional Content */}
      <div className="mockup-code rounded-tr-none rounded-br-none bg-primary text-primary-content ps-10 pb-5 pe-10 w-auto mt-8">
        <pre data-prefix="$"><code>./aboutMe</code></pre>
        <br />
        <pre><code>Name: Amy Nguyen</code></pre>
        <br />
        <pre><code>Age: 21</code></pre>
        <br />
        <pre><code>School: University of Georgia</code></pre>
        <br />
        <pre><code>Hometown: Lilburn, GA</code></pre>
      </div>
    </div>
  );
}
